import logo from "./logo.svg";
import "./App.css";

export default function App() {
  return (
    <div className="App">
      <Header />
    </div>
  );
}

function Header() {
  return (
    <header className="header">
      <div>
        <img src="travel-agency/logo.jpg" />
      </div>
    </header>
  );
}
